import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Form from './Form';
import Table from './Table';

function App() {
  const [refresh, setRefresh] = useState('false') 
  function refreshPage () {
    console.log('refreshing')
    setRefresh(val => val==='true'?'faslse':'true')
  }
  // useEffect(() => {
  //   console.log(refresh)
  // },[refresh])
  return (
    <div className="App">
      <Table heading="postgresSql" setRefresh={refreshPage} refresh={refresh} database="mongo"/>
      <Table refresh={refresh} setRefresh={refreshPage} heading="mongo" database="sql" style={{float:'left'}}/>
      <Form heading="mongo" setRefresh={refreshPage}/>
      <Form heading="postgresSql" setRefresh={refreshPage}/>
    </div>
  );
}

export default App;
